/*Table structure for table `client_version` */

DROP TABLE IF EXISTS `client_version`;

CREATE TABLE `client_version` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `creation_time` datetime DEFAULT NULL,
  `deleted` bit(1) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `app_id` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `description` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `download_url` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `platform` int(11) DEFAULT NULL,
  `version_name` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `version_num` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `client_version` */

/*Table structure for table `clientdetails` */

DROP TABLE IF EXISTS `clientdetails`;

CREATE TABLE `clientdetails` (
  `appId` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `resourceIds` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `appSecret` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `scope` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `grantTypes` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `redirectUrl` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `authorities` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `access_token_validity` int(11) DEFAULT NULL,
  `refresh_token_validity` int(11) DEFAULT NULL,
  `additionalInformation` varchar(4096) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `autoApproveScopes` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`appId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `clientdetails` */

/*Table structure for table `countries` */

