/* Trigger structure for table `topic_comments` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `update_comments_check` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `update_comments_check` AFTER UPDATE ON `topic_comments` FOR EACH ROW BEGIN
    IF NEW.burned is TRUE THEN
      UPDATE topics t set t.comments_num=(SELECT count(*) from topic_comments c where c.deleted is false and c.burned is false and c.topic_id=NEW.topic_id) where t.id=NEW.topic_id;
    END IF;
  END */$$


DELIMITER ;

/*!50106 set global event_scheduler = 1*/;

/* Event structure for event `clean_burnable_event` */

/*!50106 DROP EVENT IF EXISTS `clean_burnable_event`*/;

DELIMITER $$

/*!50106 CREATE DEFINER=`root`@`localhost` EVENT `clean_burnable_event` ON SCHEDULE EVERY 1 SECOND STARTS '2017-11-13 15:06:37' ON COMPLETION PRESERVE ENABLE DO call clean_burnable_proce() */$$
DELIMITER ;

/* Procedure structure for procedure `clean_burnable_proce` */

/*!50003 DROP PROCEDURE IF EXISTS  `clean_burnable_proce` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `clean_burnable_proce`()
begin
update topics set burned=true where burn_topic=true and burned=false and deleted=false and date_add(creation_time, interval '10' minute)<now();
update topic_comments set burned=true where is_burnable=true and burned=false and deleted=false and date_add(creation_time, interval '10' minute)<now();
COMMIT ;
end */$$
DELIMITER ;

